import React from 'react'

function Historic() {
    return (
        <div
            style={{
                width: '100%',
                border: '1px solid black'
            }}
        >
            <details>
                <summary>Historic</summary>
                <div>
                    <p>Historic</p>
                </div>
            </details>
        </div>
    )
}

export default Historic
